    [],nt"num_tags": 0,nt"name": "temperature-salinity-and-other-variables-collected-from-discrete-sample-and-profile-observation74544",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0117678 includes chemical,
    discrete sample, physical and profile data collected from KNORR in the North Atlantic
    Ocean from 1986-04-24 to 1986-05-18 and retrieved during cruise R/V Knorr WBEX.
    These data include CHLOROFLUOROCARBON-11 (CFC-11), DISSOLVED OXYGEN, HYDROSTATIC
    PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta), RADIUM ISOTOPES,
    SALINITY, SILICATE and WATER TEMPERATURE. The instruments used to collect these
    data include CTD and bottle. These data were collected by W. Jenkins and W. Smethie
    of Unknown as part of the GLODAPv2_ 316N19860424 data set.",nt"owner_org":
